function UpdateUser(){const e=$("#UserForm").serialize();$.ajax({url:"/api/admin/InstructorEdit/UpdateInstructor",type:"PUT",data:e,success:function(e){prepareToast("CheckCircle.svg","Course Updated","The Course has been updated successfully")},error:function(e){prepareToast("xmark.svg","Error",e.responseJSON.errorMessage)}})}const user_uid=$("#user_uid").val(),modaldiv=$("#ConfirmModal"),modalbody=$(".modal-body");onsubmit=function(e){switch(e.preventDefault(),e.submitter.id){case"UpdateUserBTN":UpdateUser()}},$("#RemoveRoleBTN").click(()=>{modalbody.html("<p>Are you sure you want to remove instructor role from this user?</p>"),modaldiv.modal("show"),$("#ConfirmButton").one("click",()=>{$.ajax({url:"/api/admin/InstructorEdit/RemoveInstructorRole",type:"DELETE",data:{user_uid:user_uid},success:function(e){window.location.href="/Admin/Instructors"},error:function(e){prepareToast("xmark.svg","Error",e.responseJSON.errorMessage)}}),modaldiv.modal("hide")})});